import Squiggle from './Squiggle.js'
import './Projects.css'
import maze from './maze.webp'
import plane from './plane.jpeg'

function languages() {
  return (
    <div className='program'>
      <Squiggle/>
      <div className='program-text'>
        <div className='card-container'>
          <Card
          imgSrc= {plane}
          title = "OpenFlights Data Analysis"
          description="An analysis upon"
          link="google.com"
          />
          <Card
          imgSrc= {maze}
          title = "Mazes"
          description="Implemented algorithms to generate a random maze and to solve it"
          link="/landscape"
          />
          <Card
          imgSrc= {maze}
          title = "OpenFlights Data Analysis"
          description="Mazes"
          link="/landscape"
          />



        </div>

      </div>
    </div>
  );
}

function Card({ imgSrc, title, description, link }) {
  return (
    <div className="card">
      <img src={imgSrc} alt={description} />
      <p>{title}</p>  
      <p>{description}</p>
      <a href={link}>Learn more</a>
    </div>
  );
}

export default languages;
